

CREATE TABLE `kawy` (
  `ID` int(11) PRIMARY KEY,
  `Species` int(11) NOT NULL,
  `Owner` int(11) NOT NULL,
  `Country_of_Origin` int(11) NOT NULL,
  `Region` varchar(30) NOT NULL,
  `Producer` varchar(30) NOT NULL,
  `Haravest_Year` varchar(30) NOT NULL,
  `Grading_Date` varchar(30) NOT NULL,
  `Processing_Method` int(11) NOT NULL,
  `Aroma` varchar(30) NOT NULL,
  `Flavor` varchar(30) NOT NULL,
  `Aftertaste` varchar(30) NOT NULL,
  `Acidity` varchar(30) NOT NULL,
  `Body` varchar(30) NOT NULL,
  `Balance` varchar(30) NOT NULL,
  `Uniformity` varchar(30) NOT NULL,
  `Clean_Cup` varchar(30) NOT NULL,
  `Sweetnes` varchar(30) NOT NULL,
  `Cupper_Points` varchar(30) NOT NULL,
  `Total_Cup_Points` varchar(30) NOT NULL,
  `Moisture` varchar(30) NOT NULL,
  `Color` int(11) NOT NULL,
  `Certification` varchar(30) NOT NULL,
  `Altitude_Meters` varchar(30) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


CREATE TABLE `kraje` (
  `ID` int(11) PRIMARY KEY,
  `Kraj` varchar(30) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `rodzaje` (
  `ID` int(11) PRIMARY KEY,
  `Rodzaj_Kawy` varchar(30) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `kolory` (
  `ID` int(11) PRIMARY KEY,
  `Kolor` varchar(30) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `metody` (
  `ID` int(11) PRIMARY KEY,
  `Metoda_Przetwarzania` varchar(30) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `wlasciciele` (
  `ID` int(11) PRIMARY KEY,
  `Wlasciciel` varchar(30) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

ALTER TABLE `kawy`
ADD FOREIGN KEY (`Country_of_Origin`)
REFERENCES `kraje`(`ID`);

ALTER TABLE `kawy`
ADD FOREIGN KEY (`Color`)
REFERENCES `kolory`(`ID`);

ALTER TABLE `kawy`
ADD FOREIGN KEY (`Owner`)
REFERENCES `wlasciciele`(`ID`);

ALTER TABLE `kawy`
ADD FOREIGN KEY (`Species`)
REFERENCES `rodzaje`(`ID`);

ALTER TABLE `kawy`
ADD FOREIGN KEY (`Processing_Method`)
REFERENCES `metody`(`ID`);








